-- Banking sample schema + data (MySQL 8+)
-- Includes: customers, accounts, transactions
-- Rows: customers=200, accounts=300, transactions=1000

DROP TABLE IF EXISTS bank_transactions;
DROP TABLE IF EXISTS bank_accounts;
DROP TABLE IF EXISTS bank_customers;

CREATE TABLE bank_customers (
  customer_id       INT PRIMARY KEY,
  full_name         VARCHAR(120) NOT NULL,
  email             VARCHAR(180) NOT NULL UNIQUE,
  phone             VARCHAR(20)  NOT NULL,
  pan               VARCHAR(10)  NOT NULL UNIQUE,
  city              VARCHAR(60)  NOT NULL,
  state             VARCHAR(10)  NOT NULL,
  created_at        DATETIME     NOT NULL
) ENGINE=InnoDB;

CREATE TABLE bank_accounts (
  account_id        INT PRIMARY KEY,
  customer_id       INT NOT NULL,
  account_number    CHAR(12) NOT NULL UNIQUE,
  account_type      ENUM('SAVINGS','CURRENT','SALARY','NRE') NOT NULL,
  ifsc              CHAR(11) NOT NULL,
  currency          CHAR(3)  NOT NULL DEFAULT 'INR',
  status            ENUM('ACTIVE','FROZEN','CLOSED') NOT NULL DEFAULT 'ACTIVE',
  opened_at         DATETIME NOT NULL,
  current_balance   DECIMAL(14,2) NOT NULL DEFAULT 0.00,
  CONSTRAINT fk_accounts_customer
    FOREIGN KEY (customer_id) REFERENCES bank_customers(customer_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  INDEX idx_accounts_customer (customer_id),
  INDEX idx_accounts_ifsc (ifsc)
) ENGINE=InnoDB;

CREATE TABLE bank_transactions (
  txn_id                  BIGINT PRIMARY KEY,
  account_id              INT NOT NULL,
  counterparty_account_id INT NULL,
  txn_type                ENUM('DEPOSIT','WITHDRAWAL','TRANSFER','CARD','FEE','INTEREST') NOT NULL,
  direction               ENUM('DEBIT','CREDIT') NOT NULL,
  amount                  DECIMAL(14,2) NOT NULL,
  fee                     DECIMAL(14,2) NOT NULL DEFAULT 0.00,
  currency                CHAR(3) NOT NULL DEFAULT 'INR',
  channel                 VARCHAR(20) NOT NULL,
  status                  ENUM('PENDING','POSTED','REVERSED','FAILED') NOT NULL DEFAULT 'POSTED',
  reference               VARCHAR(30) NOT NULL UNIQUE,
  booked_at               DATETIME NOT NULL,
  description             VARCHAR(255) NULL,
  CONSTRAINT fk_txn_account
    FOREIGN KEY (account_id) REFERENCES bank_accounts(account_id)
    ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_txn_counterparty
    FOREIGN KEY (counterparty_account_id) REFERENCES bank_accounts(account_id)
    ON UPDATE CASCADE ON DELETE SET NULL,
  INDEX idx_txn_account_booked (account_id, booked_at),
  INDEX idx_txn_type_booked (txn_type, booked_at)
) ENGINE=InnoDB;

